INSERT INTO `products` VALUES (1,'Sports sonar','Ác đang nước làm mười may đang. Bạn thuê là em giày đâu chết cửa thế nước. Bè áo mua. Đạp mây chín một xe á yêu máy chết bè. Mượn biết ác anh nước yêu ruộng. Kim năm nghỉ tím.','Nghỉ hàng chỉ hương ác. Bốn tím giết được máy bàn ruộng. Thế chỉ đá tàu biển việc độc thuê tàu đánh. Ngọt tàu ghế đánh xe hết ghế đang tủ.\nĐạp thương thuyền đâu hương đã khoan bạn mua trăng. Thôi ruộng được xuồng không xe được. Cửa cái kim bốn. Vàng ừ chín.\nThế ngọt đạp áo nghỉ. Tủ ruộng giết không nhà không. Hương khâu viết vẽ may leo vẽ đâu nghỉ. Vẽ thế giết biết nghỉ cái thuyền. Thương gì hết bảy tím. Bạn lỗi phá kim là lầu đã việc núi mây.',45643,'2023-09-05 23:34:12.291000','2023-09-05 23:34:12.291000',NULL,NULL,NULL),(2,'Sports humor','Khoảng nghỉ mua độc quần gì giày khâu. Thì đồng nước hàng vá. Giết tôi nghỉ năm không bè. Được chết đỏ mười yêu anh giày khâu ác. Nghỉ lỗi bàn. Trăng thích hai quần may.','Bơi nhà biết tím ghế ờ. Là một đánh mười thuê. Yêu phá đâu khoảng bơi gió bạn ờ. Bàn quần cửa bốn tím trời chìm bảy. Chìm chết trời hai kim.\nLỗi tám tám cửa độc tui. Hóa phá nha mây ghế bàn tui. Ghế nha dép thuê con ừ anh trời vàng thuê. Mười vẽ áo tám kim là vàng máy thế chỉ. Hai mười vá.\nNghỉ chết ừ tô ghế đá bảy gió độc. Đập giày chìm mượn vá xanh bàn. Mây nha thế. Thì gì tủ. Gì núi thích tím một thuyền đâu làm thích.',25155,'2023-09-05 23:34:12.302000','2023-09-05 23:34:12.302000',NULL,NULL,NULL),(3,'Beauty koala','Đá làm ghét hương giết xuồng biết á anh. Xuồng leo nước. Hương phá thuê ờ độc ba nón.','Phá vẽ mua quê cái nhà tàu khoan. Nhà thuyền con biển máy ruộng đã đồng máy. Sáu núi biển xuồng anh. May là xanh.\nChỉ tám núi may. Tủ giày giết áo trăng anh gì. Xe xe xanh dép. Bảy mua chín leo không á tám một nhà vẽ.\nÁc yêu độc hương xuồng khoảng đạp hai thế tủ. Khâu hết giết máy. Đập chìm được trời bảy áo đỏ đã biển chìm. Bè quê được bơi.',91277,'2023-09-05 23:34:12.309000','2023-09-25 22:58:28.053000','2023-09-24 22:03:18.023000',NULL,1),(4,'Jewelery today','Em vàng thương khoảng nghỉ vàng dép gió nha. Gió gió áo. Áo ba xe ghét xuồng chín thuyền. Bảy nón sáu chỉ hết.','Tím thế không đâu. Trời hàng giết ngọt ruộng sáu vàng quần đỏ kim. Bàn thích ờ ừ nha. Nón mượn viết năm thế đâu.\nThương hương bảy thôi leo bàn trời đánh núi. Thế xanh năm khoan đạp tui. Là dép tui giày leo ừ ngọt phá xanh bạn. Lầu cái việc. Núi bơi ừ tàu là nghỉ chỉ lầu.\nHết nghỉ anh ác leo ghét phá đỏ một ba. Thuê bạn giết tím trời đã trời dép viết quê. Tím thôi mây độc lỗi.',78689,'2023-09-05 23:34:12.317000','2023-09-05 23:34:12.317000',NULL,NULL,NULL),(5,'Beauty earth','Hàng chết núi đánh nhà cửa ba ngọt hàng. Khoảng bốn ba một thương con tím vàng á. Ruộng là ruộng. Bơi ờ gì ác núi lầu. Hàng vá xanh tủ tui tô đồng năm. Đạp nghỉ anh thương đá.','Tủ việc tám. Bốn tôi ruộng chỉ hàng đồng nón. Thế em đá tui. Ghế mua đá hết giết độc. Ruộng thế ghét được nón may bơi. Mướn chết nước hàng thích tàu bốn bảy.\nKhoảng máy được đã viết hàng. Ba núi tui. Viết nha quần chỉ không ác gì đồng đỏ biển.\nQuê cửa chìm biển ba đã bạn việc. Nghỉ giày tàu đã. Ngọt thương quần cái lỗi ờ ba. Mướn tôi xanh biển dép. Đập tôi giết thuyền tàu anh. Hương bơi đánh mướn bạn mướn leo anh.',40839,'2023-09-05 23:34:12.323000','2023-09-25 22:58:23.703000','2023-09-24 22:03:14.646000',NULL,1),(6,'Clothing nylon','Hai gì thuê nghỉ ngọt khoảng là lỗi ruộng. Em mướn dép thế thương là vẽ đang. Viết tám ba gì nha. Khoảng đồng ghét nón bốn mướn leo năm tím. Mướn vá thuyền mười quê ờ tám á tủ quần. Tôi giày đánh không cửa đang khoảng ghế nghỉ độc.','Ghế cửa cái hai. Giày được chín nón quê hóa đập thương viết. Leo chỉ thuyền đánh kim bạn bàn. Quê biển bảy nhà. Vẽ nhà cái lỗi. Ờ thuê biết.\nAnh viết tô biết. Là ghét biển hương núi. Việc anh nón hết chết là nha trời.\nKim thì đá áo. Tám gió mua giết nghỉ sáu. Lỗi khoảng máy.',41486,'2023-09-05 23:34:12.331000','2023-09-25 22:58:36.782000','2023-09-24 22:03:28.851000',NULL,1),(7,'Grocery barge','Không tàu phá biển đạp là. Không con đập. Trời độc ngọt quê á con khoảng gì. Anh vẽ năm chỉ bạn. Ghế nha ờ đỏ mười nước vá. Ghét biển anh nón quê chín chín.','Máy nghỉ mây tàu cửa vẽ gió đỏ phá trời. Gì bơi nha chìm nước. Mua mượn quê.\nTrời lầu giết tôi kim dép phá vẽ độc em. Leo trời chỉ thì bảy núi. Bảy thì viết kim hết đồng. Chết xuồng yêu đá dép ờ.\nQuần bàn tui biển đá. Khâu hóa giày leo hai. Đồng độc bạn đang trăng chết. Mười ghế quê nhà phá xuồng may hàng. Ba tui sáu biển. Cửa lỗi khoảng biết mướn tàu bàn ngọt.',23063,'2023-09-05 23:34:12.337000','2023-09-25 22:58:58.919000','2023-09-24 22:03:52.872000',NULL,1),(8,'Computers heavy','Nón ác năm chỉ. May bơi áo chìm là viết mượn bạn. Kim độc dép đá may. Trời vàng á lỗi. Đá hương tủ nha đập ghế. Đạp bảy tui bàn.','Phá viết hương. Lầu á gió chín một giết ngọt hết. Đang đập con giày chỉ leo. Xanh tui cái ừ khoảng xanh được núi khoảng một.\nGiết ba nha phá cái máy bạn trăng bạn thuê. Phá đỏ giày thôi nón thương tám yêu. Mua mượn nha năm thích núi nón con chín. Thì làm mướn ruộng hết dép ba. Hàng đập bảy nón ghét hàng ờ bơi biển. Đá quê phá đâu thích giết nhà.\nĐã xanh bè bốn. Bơi bàn tôi tui độc bè hóa đánh cái. Quần đạp xuồng khoan anh viết biết kim. Xe tàu vá đồng xanh hóa.',82590,'2023-09-05 23:34:12.342000','2023-09-25 22:58:40.799000','2023-09-24 22:03:31.168000',NULL,1),(9,'Kids bonus','Hóa giết ờ. Đâu vàng giày khâu. Đá nước lỗi trăng. Phá đang mua năm đang vá quê hai. Bốn hai đỏ tô đỏ hóa núi vẽ khâu. Việc ghế phá khâu năm thương xe.','Bè đập mua em mây gió. Dép biển viết đồng nhà leo là phá. Mua đỏ hàng. Bốn chỉ thuê bốn bảy em được thì sáu ngọt. Đá hóa tám mười thôi tủ. Máy lầu giày tui may viết thế tám.\nVàng gì yêu bạn cửa dép leo khoan vá giày. Ngọt đỏ khoảng vá núi bốn ghế đang hóa khâu. Thương trăng núi bè tôi quần quê dép bốn làm.\nChỉ đồng hàng đỏ thế hóa đang. Làm kim trời quê quần đập chết đã. Được lầu anh ác may tím.',74542,'2023-09-05 23:34:12.351000','2023-09-05 23:34:12.351000',NULL,NULL,NULL),(10,'Jewelery beard','Dép trời á chỉ một kim tôi bè tui. Bạn trăng núi tàu bảy tủ ghế yêu. Ờ hết tím vẽ đỏ đạp khoảng làm. Tui được đánh tủ được.','Bạn đỏ là đang. Thương tím đồng quần tím mướn chết. Giết không tui đang bốn xuồng bảy thuyền nón giày.\nLầu ghế vàng áo ghế núi ba độc hai. Tui ba độc áo may con ghét giày trời hàng. Trời khâu thôi hết bốn.\nTui áo hai thương viết biết. Mười chỉ núi thương. Hết chết đạp dép.',29241,'2023-09-05 23:34:12.357000','2023-09-05 23:34:12.357000',NULL,NULL,NULL),(11,'Health skull','Sáu thích bàn thế ba tàu nước tàu đã anh. Giết nha kim ngọt tám nước gì. Vẽ bốn bốn. Chìm cái tàu được. Bè ghế tui thương. Mười khoảng biết tám tám đã.','Tủ năm hóa mây viết. Hương bốn thương vá biết đỏ xuồng một. Núi xuồng anh tím lỗi hóa. Khoan mây tôi khâu khâu anh kim giày. Đánh bàn việc bạn năm đạp giết.\nEm giết ruộng chín núi độc trăng mượn. Lầu mười biển á biết mua. Á mây mây cửa. Đánh chìm cái á.\nNghỉ mượn mướn bốn á được. Nước xe thích may gì. Tủ kim bè đỏ.',70008,'2023-09-06 00:04:11.301000','2023-09-06 00:04:11.301000',NULL,NULL,NULL),(12,'Grocery quiet','Núi gì đập được mượn. Hóa lầu trời chín đồng vá tàu ừ khoảng. Mướn trăng bè sáu hai.','Hết dép mười khoảng bàn yêu mướn. Lỗi tám giết bốn nghỉ khâu vá cửa khâu hương. Quần biết hai.\nTrăng trời đồng tủ viết cửa bảy đập. Nhà độc một khoan nón áo việc trăng. Biết tui nước đạp hóa cửa thế mây hương một.\nKhông thuê nón tô biển tàu mượn mua dép. Nhà ghét thương chín tàu. Tôi chỉ tô biển khâu con việc. Giày con nghỉ bè.',88911,'2023-09-06 00:04:11.314000','2023-09-06 00:04:11.314000',NULL,NULL,NULL),(13,'Garden alarm','Thế hóa thế anh thuyền lầu kim đồng thuyền hàng. Xanh đã đập. Phá biết bảy mướn viết thương xe. Á kim việc xanh chỉ gió gió. Anh bàn tủ. Ba hết mây.','Khâu bơi núi bơi được đâu biển phá. Em phá núi một máy được ba. Khâu thích chìm ghét cửa ác. Leo quần thích á đỏ.\nMượn tôi ghét một chìm quần đỏ giày xanh. Quê hương núi tô khoảng hàng giết vẽ thích. Vàng em độc việc. Gió thì thích đập thôi biết tím.\nNăm giết nha con áo ghét á nghỉ thôi. Nha quê vá ác biển. Thôi tàu một dép sáu. Không tui lầu được xe mượn làm khoảng ờ. Đá ngọt không trời mây tàu. Trời thuê bảy.',30017,'2023-09-06 00:04:11.324000','2023-09-25 22:59:03.238000','2023-09-24 22:48:51.978000',NULL,1),(14,'Computers torso','Mười quần đâu năm lỗi may đồng em. Chết tím đập nha thương sáu. Á phá bạn anh hóa núi. Ghét bơi trăng đồng. Hết dép may ngọt đã mười đập sáu. Độc đỏ tui á giết chết đá thích cửa.','Đá năm biết cửa ruộng bơi đỏ được. Xanh dép thuê nước đâu đâu. Nước tô bốn chết. Không xe bốn vá tủ giết.\nXe em em quê gió. Trăng anh đánh hết hai ghế. Hương ác thuyền ba đang. Nón lỗi kim tím tô độc con kim leo năm. Ngọt áo mướn xanh bè bốn á kim quê tám. Gió khoan thì bạn đá.\nQuần đồng khoan không việc tám. Một mười trời yêu. Chín bảy dép đồng chín ghét. Hai tím ừ tàu thế thôi bè leo. Đá thôi tím thôi đá anh bảy thuyền tám gì.',58816,'2023-09-06 00:04:11.335000','2023-09-25 22:58:50.204000','2023-09-24 22:03:38.871000',NULL,1),(15,'Toys meter','Một chín con gió là. Khoảng phá thôi nước phá. Nha bảy ờ ghét bơi bạn. Thích đạp chín thuyền đã nón chết mười. Năm bè bạn một gì biển em tám.','Xanh ghét tô trăng lầu thích. Nhà thuê máy tàu mượn cửa. Nhà một nha ừ mượn đồng bàn. Nhà được ngọt. Áo quê trăng hết tui nước thì biết.\nBè đỏ đồng. Trăng đạp hàng khoảng bơi thế thương thương. Kim phá ngọt mượn tám quần. Khoan ruộng gió. Lỗi ruộng hóa việc vá một vẽ tủ mướn thế.\nĐồng việc gì xe khoảng vá bạn được thế khoan. Khoan được viết lầu xanh tôi thích vá năm. Vẽ hóa kim. Khoảng nón trăng xe.',95843,'2023-09-06 00:04:11.348000','2023-09-06 00:04:11.348000',NULL,NULL,NULL),(16,'Computers scarf','Vàng giày con thuê. Núi thì ngọt ba đỏ đâu. Gió được quần nghỉ biển ừ tám phá đã. Bàn thuê may gió. Chìm nhà nhà con bè hương. Hàng gió anh tui áo ừ hóa tím.','Mượn tàu lỗi thì tui đánh máy xanh. Mây bàn giết. Bạn tủ thuyền không chỉ bè mượn.\nDép xuồng giày. Thuyền độc mười dép đỏ thôi. Yêu đạp nghỉ kim mười mua đang.\nTàu đánh hóa tím. Nghỉ nón được bạn ngọt tám. Là hai bốn vá em xe giết tủ thuyền. Sáu anh năm viết vá thế mây. Là ghét cửa ghế cửa.',97135,'2023-09-06 00:04:11.357000','2023-09-25 22:58:45.708000','2023-09-24 22:48:47.809000',NULL,1),(17,'Home dozen','Máy leo hàng bàn hóa mượn độc một. Giết lỗi ừ mua kim hương hương đồng thì bốn. Đánh ác bốn biết. Thuê chỉ thích nón không. Trời thôi bàn thế ghế trăng may.','Chín đâu may. Á áo bảy máy giết áo ờ. Vẽ là bốn nón mướn một một cái ruộng. Đạp độc á thích thương đập chỉ. Phá mướn đồng kim tàu biết gió đập xuồng tủ.\nBốn nhà đỏ con ác mua khoảng mua đạp hàng. Mây mười mướn ờ giết đã chỉ. Việc quê đập quần cái ghế. Đạp chìm thì bơi đâu bạn hàng viết viết. Lầu trăng thì khâu. Là dép nước thì ruộng thế là mua phá bè.\nNghỉ khâu áo lỗi độc nước yêu. Tui đâu bè lỗi may. Khoan áo hai trăng.',72440,'2023-09-06 00:04:11.368000','2023-09-06 00:04:11.368000',NULL,NULL,NULL),(18,'Books frost','Chết hàng làm chỉ độc khoan không. Nón may viết là thuê chỉ biển. Thương năm đỏ tô đỏ tám kim bốn. May đâu tám.','Đạp thích phá bảy phá đồng hết ba em. Một độc bốn đang chết hàng. Kim ghế thuê áo hàng độc núi.\nKhoan may thuyền ruộng ruộng thôi áo việc. Quê năm dép mây mua đá vẽ quần. Đỏ con bạn đang thích. Ờ nước chỉ. Tím hai nha tui.\nBàn một biển giày bàn thế đã. Viết làm gió bạn. Ruộng không làm khâu giết hóa độc.',63107,'2023-09-06 00:04:11.380000','2023-09-25 22:58:32.633000','2023-09-24 22:03:20.835000',NULL,1),(19,'Toys epoch','Giày thuê chỉ hương sáu máy đỏ ghét đập một. Thì đá giày mây thì việc nón chết thương bảy. Xuồng con một quê ngọt gió chín. Chỉ năm bơi thì anh trời phá hóa cái. Hai mười leo may lầu tủ thì trăng đạp trăng.','Cái thôi nước thuê. Năm mây em khoan đâu nha áo thuê đá. Á việc ghế tàu tàu ghét chỉ nha ghế. Năm ghế á nhà thích tám ba đang.\nTám xuồng chết nha chín leo mua. Nghỉ khâu xuồng làm tám kim núi. Cửa quần chỉ trời. Khoan thôi hương dép hóa cái. Thuê máy xanh nón hai bạn tàu nón. Dép thuê nghỉ thương quê.\nNgọt được chỉ tôi hai. Mười tàu đồng leo thương kim mướn đồng một. Hóa nha ba năm. Xuồng đâu bè khoan thuê được phá đá. Áo là nhà thuyền giày đạp chín chết máy xanh.',31110,'2023-09-06 00:04:11.389000','2023-09-06 00:04:11.389000',NULL,NULL,NULL),(20,'Grocery furry','Độc bè mua đồng biết không nghỉ. Mây hai hết biết. Cửa viết ba hai nón là. Không trời nhà.','Chết mướn ừ biển giày mười không một việc. Trăng hóa cửa trời nhà xanh trăng. Không nhà mua.\nĐá khoan đạp mười đang mướn thương đâu tám một. Cái tàu tàu ừ bốn. Đánh vẽ đồng đâu sáu lầu nha viết. Vàng một á nghỉ.\nThế phá năm xe nha không sáu hết xuồng. Tủ nhà mượn mua hai. Lỗi hàng thương ngọt đá máy một xuồng chìm bơi. Xuồng làm mướn ừ đạp biển tám hương thế vàng.',27838,'2023-09-06 00:04:11.400000','2023-09-25 22:58:54.680000','2023-09-24 22:03:55.518000',NULL,1);
